import React from "react";
import { Link } from "react-router-dom";
import './header.css';




function DashboardHeader(props) {
  return (
      <header>
        <nav>
          <ul>
            <ul className="menuul">
            <li><Link to="/">Home</Link></li>

            <li>Welcome {props.currentUser}</li>
            </ul>
          </ul>
        </nav>

                 </header>
    );
}
  export default DashboardHeader;
